INSERT INTO `menu_custom` (`menu_name`, `title`, `description`) VALUES
('devel', '开发', 'Development link'),
('main-menu', '主菜单', '<em>主</em>菜单在多数站点用于显示站点的主要部分，往往位于顶部导航栏。'),
('management', 'Management', '<em>管理</em>菜单包含管理任务的链接。'),
('navigation', '导航', '<em>导航</em>菜单包含供站点访问者使用的链接。一些模块会自动向<em>导航</em>菜单添加链接。'),
('user-menu', 'User menu', '<em>用户</em>菜单包含与用户帐户有关的链接，以及“注销”链接。');
